import React, { Component } from 'react';
import Search from "../Component/Search";
import Slide_one from "../Component/Slide_one";
import Ceo from "../Component/Ceo";
import New_silde from "../Component/New_silde";
import Pub_slide from "../Component/Pub_silde";
import Homecardic from "../Component/Homecrdic/Homcardic";
function Homecardicepage() {
  return (
    <div className="App">
      <Search/>
      <Homecardic/>
      <Ceo/>
      <New_silde/>
      <Pub_slide/>
    </div>
  );
}
export default Homecardicepage;
